import 'package:flutter/cupertino.dart';
import 'package:flutter/material.dart';
import 'package:task_manager_project/screen/TaskAppBar.dart';
import 'package:task_manager_project/screen/appBottomNav.dart';
import 'package:task_manager_project/screen/cancelTaskList.dart';
import 'package:task_manager_project/screen/completedTaskList.dart';
import 'package:task_manager_project/screen/newTaskList.dart';
import 'package:task_manager_project/screen/progressTaskList.dart';
import 'package:task_manager_project/utility/Utility.dart';

class HomeScreen extends StatefulWidget {
  const HomeScreen({Key? key}) : super(key: key);

  @override
  State<HomeScreen> createState() => _HomeScreenState();
}

class _HomeScreenState extends State<HomeScreen> {

  int bottomTabIndex = 0;

  Map <String,String> ProfileData = {"email":"","firstName":"","lastName":"","photo":"data:image/webp;base64,"};

  onItemTapped(int index){
    setState(() {
      bottomTabIndex = index;
    });
  }

  final widgetOptions = [
    NewTaskList(),
    ProgressTaskList(),
    CompletedTaskList(),
    CancelTaskList()
  ];

  ReadAppBarData() async{
    String? email = await ReadUserData('email');
    String? firstName = await ReadUserData('firstName');
    String? lastName = await ReadUserData("lastName");
    String? photo = await ReadUserData('photo');

    setState(() {
      ProfileData = {"email":"${email}","firstName":"${firstName}","lastName":"${lastName}","photo":'${photo}'};
    });
  }
  @override
  void initState() {
    // TODO: implement initState
    ReadAppBarData();
    super.initState();
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: TaskAppBar(context,ProfileData),
      body: widgetOptions.elementAt(bottomTabIndex),
      bottomNavigationBar: appBottomNav(bottomTabIndex,onItemTapped),
    );
  }
}
